import React from 'react';

const Navbar = () => {
    return (
        <div>
             <nav class="navbar navbar-dark justify-content-between flex-nowrap flex-row">
            <div class="container">
                <a href="/" class="navbar-brand float-left col-sm-12 col-md-4 col-lg-3">Alexander Pham</a>
                <ul class="nav navbar-nav flex-row float-right">
                    <li class="nav-item"><a class="nav-link pr-4 active" href="index.html">About</a></li>
                    <li class="nav-item"><a class="nav-link pr-4" href="portfolio.html">Portfolio</a></li>
                    <li class="nav-item"><a class="nav-link" href="contact.html">Contact</a></li>
                </ul>
            </div>
          </nav>
        </div>
    )
}
export default Navbar;
